import React from "react";
import "bootstrap/dist/css/bootstrap.min.css"; // Ensure Bootstrap CSS is imported
import logo from "./assets/logo.png";
import protection from "./assets/protection.png";
import lungs from "./assets/lungs.png";
import food from "./assets/food.png";
import mind from "./assets/mind.png";
import doge from "./assets/vetdoge.jpg";
import tic from "./assets/tic.png";

// Data for the feature cards
const features = [
  { img: protection, title: "Защита от зарази", description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus." },
  { img: lungs, title: "100% възтановяване", description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.", highlighted: true },
  { img: food, title: "Натурални съставки", description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus." },
  { img: mind, title: "Без травми", description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus." }
];

// Data for the benefits list
const benefits = [
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit."
];

function App() {
  return (
    <div className="container py-5">
      {/* Header section */}
      <div className="position-relative bg-light" style={{ height: "900px" }}>
        <div className="w-100 h-100 d-flex justify-content-center align-items-center" 
             style={{
               backgroundImage: `url('./assets/animals.png')`,
               backgroundSize: "cover",
               backgroundRepeat: "no-repeat",
               backgroundPosition: "center",
               borderBottom: "4px solid black"
             }}>
          <h1 className="text-white display-3" style={{ fontFamily: "'Lobster', cursive" }}>Welcome to Our Site</h1>
        </div>
      </div>

      {/* Logo section */}
      <div className="row justify-content-center py-3">
        <div className="col-md-6 text-center">
          <img src={logo} alt="Bio Logo" className="img-fluid" style={{ maxWidth: "300px" }} />
        </div>
      </div>

      {/* Main text */}
      <div className="row py-3">
        <div className="col-12 text-center">
          <h1 className="display-3" style={{ fontFamily: "'Lobster', cursive" }}>Грижим се за тяхното здраве</h1>
        </div>
      </div>

      {/* Feature cards section */}
      <div className="row justify-content-center py-3">
        {features.map((feature, index) => (
          <div key={index} className="col-md-6 col-lg-3 mb-4">
            <div className={`card p-3 border rounded ${feature.highlighted ? "bg-primary text-white" : "bg-light"}`}>
              <img src={feature.img} alt={`${feature.title} Icon`} className="card-img-top img-fluid mb-2" style={{ width: "92px", height: "92px", objectFit: "cover" }} />
              <div className="card-body">
                <h5 className="card-title" style={{ fontSize: "24px", fontWeight: "700", lineHeight: "31.2px" }}>{feature.title}</h5>
                <p className="card-text" style={{ fontSize: "16px", fontWeight: "400", lineHeight: "20.8px" }}>{feature.description}</p>
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* Choose us section */}
      <div className="row py-5">
        <div className="col-md-6 mb-4 mb-md-0">
          <img src={doge} alt="Decorative" className="img-fluid rounded" style={{ borderRadius: "10px" }} />
        </div>
        <div className="col-md-6">
          <h1 className="display-4" style={{ fontWeight: "700", lineHeight: "62.4px" }}>Защо да изберете нас?</h1>
          <ul className="list-unstyled">
            {benefits.map((benefit, index) => (
              <li key={index} className="d-flex align-items-center mb-3" style={{ fontSize: "16px", fontWeight: "400", lineHeight: "20.8px" }}>
                <img src={tic} alt="Check" className="me-2" />
                {benefit}
              </li>
            ))}
          </ul>
          <a href="#" className="btn btn-link" style={{ fontSize: "16px", fontWeight: "500", color: "#0360d9" }}>Learn More →</a>
        </div>
      </div>
    </div>
  );
}

export default App;
